import React from 'react';
import FooterTopBg from '../../assests/bg-footer-top-mobile.svg';
import { Foooter, Image, FooterWrapper } from '../../components/styles/HuddleFooter.styled';
import Contact from '../../components/HuddleFooter/Contact/Contact';
import Newsletter from '../../components/HuddleFooter/Newsletter/Newsletter';
import { Img } from '../../components/styles/HuddleIllustration.styled' 

const Footer = (props) => {
    return (
        <Foooter>
            <Img Src={FooterTopBg} className='mobile' Alt={"Curved Section"} />
            <FooterWrapper Display={'column'} BGColor={'hsl(192, 100%, 9%)'}>
                <Newsletter />
                <Contact />
            </FooterWrapper>
        </Foooter >
    );
}

export default Footer;
